						"returns": "<p>Returns<br>Our policy lasts 7 days. If 7 days have gone by since your purchase, unfortunately we can&#x2019;t offer you an exchange. <br><br>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging. <br><br>To complete your return, we require a receipt or proof of purchase. <br><br>Refunds (if applicable)<br>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.<br>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within 7 days. <br><br>Sale items (if applicable)<br>Only regular priced items may be refunded, unfortunately sale items cannot be refunded.<br><br>Exchanges (if applicable)<br>We only replace items if they are defective or damaged due to a production flaw. If you need to exchange it for the same item, send us an email at info@afreaka.co.za and send your item to: Unit 1 Canterbury Studios, cnr Upper Canterbury and Wesley Street, Cape Town, 8001.<br><br>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund. <br><br>Depending on where you live, the time it may take for your exchanged product to reach you, may vary.<br><br>We suggest using a trackable shipping service or purchasing shipping insurance. We don&#x2019;t guarantee that we will receive your returned item.</p>",
