				"returns": "<dl>\r\n\t<dt id=\"answer3\"><strong>Returns &amp; Replacements</strong></dt>\r\n\t<dd>Need to return an item or all of your order? No worries! We have a killer 60-day Risk-Free/Hassle-Free Return Policy. Just follow the return instructions on your invoice that was shipped with your order and make sure all original tags are still attached. We want every visitor to have a good shopping experience so we make it super easy to return stuff. But...if it&#39;s after 60 days...sorry, you&#39;re outta luck...so don&#39;t ask!<br />\r\n\t<br />\r\n\t<strong>To return to Metal Mulisha:</strong>&nbsp;<br />\r\n\tPlease follow these steps to help us process your return:</dd>\r\n\t<dd>Complete the return form that came with your order by checking the &ldquo;Return&rdquo; box and filling it out for each item being returned. Determine the &ldquo;Reason Code&rdquo; from the key below and include a code for each item, then place the completed form inside of your package. If you do not have the invoice that came with your order, please contact us to obtain a new one. Then detach and fasten the unpaid return barcode label to the outside of your package. If a UPS label is included with your shipment, fasten it to the outside of your package and call UPS to schedule a pickup or take it to the nearest UPS store. Remember to remove or cover any other labels and barcodes on the package. Send the return to the address below:<br />\r\n\t<br />\r\n\tSend all returns to: Metal Mulisha Web Returns - 14350 Myford Rd., Irvine CA 92606</dd>\r\n\t<dd>Keep tracking on your return as we are not liable for returned merchandise that is lost in transit. Please allow 2-4 weeks for your return to be processed. Also, be aware that your credit card company may require an additional 3-7 days to post the credit to your account. We will send you a confirmation email once it has been processed by our warehouse.</dd>\r\n\t<dd><br />\r\n\t<strong>What happens if I have received damaged or incorrect merchandise?</strong><br />\r\n\tIf your merchandise is incorrect or damaged, please contact Customer Service with photos of the damage so we can send you the proper forms to get this corrected as quickly as possible. We will refund or replace the damaged merchandise.</dd>\r\n\t<dd>Address for damaged or incorrect product:</dd>\r\n\t<dd>Metal Mulisha Consumer Replacements<br />\r\n\t14350 Myford Rd.<br />\r\n\tIrvine CA 92606</dd>\r\n\t<dd>We recommend you ship your item with a carrier that provides a tracking number as well as insurance. Metal Mulisha will not be held liable for products lost in transit. Turn around time for credits and replacements is 2-4 weeks.</dd>\r\n\t<dd><strong>Do I have to cover the cost of return shipping?</strong><br />\r\n\tReturn shipping labels are included free of charge for USA orders over $100.</dd>\r\n</dl>\r\n",
