				"returns": "<p><span style=\"color:rgb(0, 0, 0); font-family:microsoft sans serif; font-size:14.6666669845581px\">Converse.com will gladly refund or exchange any unworn merchandise, along with receipt and original packaging in good condition, within 30 days of the date you received it.</span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><strong>1) Log in to your Converse.com account and review My Orders on the Order Status page.</strong></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><span style=\"font-size:11pt\">- If you weren&#39;t logged in during order placement, or created an account after your order was placed, you&#39;ll need to find your order.</span></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><span style=\"font-size:11pt\">- If you are not a Registered Converse.com User, you may go directly to the&nbsp;Order Status page&nbsp;and fill out the form to bring up your order information.</span></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><strong>2) Select the item(s) to be returned.</strong></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><span style=\"font-size:11pt\">- Fill out your address, reason for return, and the weight and box dimensions (you can estimate).</span></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><span style=\"font-size:11pt\">- If exchanging, please note which item you would like to exchange for. Select print and attach the label to your package.</span></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><span style=\"font-size:11pt\"><span style=\"font-size:11pt\"><span style=\"font-size:11pt\">- Return/Exchange labels can be printed online through your account on Converse.com.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\"><strong>3) Drop your package off at an authorized UPS shipping location.</strong></span></p>\r\n\r\n<p><span style=\"font-family:microsoft sans serif; font-size:11pt\">If you have any additional questions about shipping back your return, please&nbsp;contact us!</span></p>\r\n",
