						"description": "<div> Chuck Taylor All Star Classic Colors <p> The Chuck Taylor All Star high top is the most iconic sneaker in the world, recognized for its unmistakable silhouette, star-centered ankle patch and cultural authenticity. And like the best paradigms, it only gets better with time. For generations, these classic colors and quality vulcanized rubber sole have defined an icon. Born on the court but adopted by rebels, rockers, rappers, artists, dreamers, thinkers and originals, the Chuck Taylor All Star continues to celebrate personal style and individual self-expression. </p> <div></div> <p> Hi Canvas </p> </div>",
