				"returns": "<p>EXCHANGES/RETURNS</p>\r\n\r\n<p><strong>Q: What&rsquo;s your exchange/return policy?</strong><br />\r\n<br />\r\nA: We hope you love what you&rsquo;ve ordered, but if there&rsquo;s an issue or you&rsquo;re not 100% satisfied, return your item(s) to the nearest Hot Topic store, or by mail using our&nbsp;self-serve return form. [http://img.hottopic.com/is/content/HotTopic/HT_SelfServeReturnFormpdf]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>Please save the invoice you received with your package. It&rsquo;s your receipt in case you need to exchange/return your item(s)!</li>\r\n\t<li>All clearance items purchased on Hottopic.com are final sales and cannot be exchanged or returned.</li>\r\n\t<li>Merchandise cannot be returned if washed or worn.</li>\r\n\t<li>Exchanges/returns must be initiated within 30 days of the purchase date listed on the front of your receipt. Hot Topic items sell quickly, so contact us as soon as possible to make exchanges.</li>\r\n\t<li>Allow 2-4 weeks for processing exchanges/returns.</li>\r\n\t<li>You&rsquo;re responsible for selecting your preferred shipping carrier and method. We recommend using one that can be insured and tracked. Hot Topic is not responsible for lost or damaged packages.</li>\r\n\t<li>Merchandise purchased with a credit card or gift card can be exchanged or returned at your local Hot Topic if you have the receipt.</li>\r\n\t<li>If you purchased through a third party such as Paypal, your exchange or return can only be made by mail. Please contact Customer Service at&nbsp;1.800.892.8674 or +1.626.603.3182 for international customersfor further instructions. Sorry, we&rsquo;re unable to process third-party returns within our stores.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: How do I exchange something?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A: If you&rsquo;re unable to exchange your item(s) at a Hot Topic store, you can easily exchange with us. Here&rsquo;s what you need to know:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>Contact Hottopic.com Customer Service at&nbsp;1.800.892.8674 or +1.626.603.3182 for international customers&nbsp;to process your exchange.</li>\r\n\t<li>Return your item(s) by filling out the fields in the return form that&rsquo;s printed on the back of your order invoice.</li>\r\n\t<li>Pack your return securely, in the original package if possible, and include your completed return form. Do not tear off the bottom of the invoice. We need the entire form to identify the order.</li>\r\n\t<li>You&rsquo;re responsible for selecting your preferred shipping carrier and method. We recommend using one that can be insured and tracked. Hot Topic is not responsible for lost or damaged packages.</li>\r\n\t<li>You will not be reimbursed for your original or return postage.</li>\r\n\t<li>You will not receive a refund for your return until we receive your returned item.</li>\r\n\t<li>You will not be charged a shipping fee for your exchange, unless you request upgraded shipping.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: How do I return something?</strong><br />\r\n<br />\r\nA: If you&rsquo;re unable to return your item(s) at a Hot Topic store, you can easily use our self-serve return process. Here&rsquo;s what you need to know:</p>\r\n\r\n<ul><br />\r\n\t<li>Return your item(s) by filling out the fields in the return form that&rsquo;s printed on the back of your order invoice.</li>\r\n\t<li>Pack your return securely, in the original package if possible, and include your completed return form. Do not tear off the bottom of the invoice. We need the entire form to identify the order.</li>\r\n\t<li>You&rsquo;re responsible for selecting your preferred shipping carrier and method. We recommend using one that can be insured and tracked. Hot Topic is not responsible for lost or damaged packages.</li>\r\n\t<li>You will not be reimbursed for your return or original postage.</li>\r\n\t<li>You will not receive a refund for your return until we receive your returned item. Allow 2-4 weeks for processing and 1 to 7 business days to receive your credit.</li>\r\n\t<li>Still have questions? Email us at&nbsp;returnexchange@hottopic.com. Or, give us a call at 1.800.892.8674 (+1.626.603.3182 for international customers).&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: Will I be able to return my order at a Hot Topic store if I paid online through</strong><strong>a third party</strong><strong>?</strong><br />\r\n&nbsp;<br />\r\nA: Sorry, but our stores are unable to accept your return if you paid online through a third party. Just give Hottopic.com Customer Service a call at 1.800.892.8674 (+1.626.603.3182 for international customers) and we&rsquo;ll help you out! &nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Q: If I return merchandise, how long will it take to receive my credit?</strong><br />\r\n<br />\r\nA: We&#39;ll process your credit as soon as we receive your returned merchandise in our warehouse. Typically, the purchase amount will be restored to your credit card in 1 to 7 business days, depending on your financial institution&rsquo;s policy regarding credits. If you paid for your purchase with a Hot Topic gift card, a new gift card will be sent to you in the amount of the merchandise returned. You will not be reimbursed for your original or return postage.</p>\r\n",
