				"returns": "<p><strong><span style=\"font-size:14px;\">RETURN POLICY</span></strong></p>\r\n\r\n<p>We believe our toys and other products must live up to your highest expectations, and our service must live up to the quality of our toys. If for any reason you need to return your order, it&rsquo;s easy! Simply follow the instructions listed on the back of the packing slip you received with your order.</p>\r\n\r\n<p>All returns or exchanges must be made within 90 days of receipt of your order and must be accompanied by a Return Authorization Number. To obtain a Return Authorization Number, please call Customer Service at 1-800-835-4386 between the hours of 8:00 am &ndash; 10:00 pm EST Monday through Friday and 10:00 am &ndash; 6:00 pm EST Saturday and Sunday. Returns of orders that do not include a Return Authorization Number may be subject to additional processing time and delay in crediting your account. Return address information can be found on the reverse side of your packing slip or on a separate sheet included in your order. All refunds are made in the original payment method. For orders purchased by check or money order, a refund check will be made payable to the &ldquo;Ordered By&rdquo; name. Shipping and handling charges are non-refundable. We recommend using a shipping method that can be tracked and insured for your protection.</p>\r\n\r\n<p><strong>Unopened Sets:&nbsp;</strong>Simply return your unopened LEGO set to the address listed on your packing slip. If the total value of the unopened set is under $200, you can return your unopened LEGO set to any of our LEGO Brand Retail stores with your original packing slip or receipt, and we&#39;ll give you a full refund to your original payment method. Returns of unopened sets to a LEGO Brand Retail store that are not accompanied by a packing slip or receipt may be exchanged at its current value toward other product(s). Total value of returned items over $200 cannot be returned in the store.</p>\r\n\r\n<p><strong>Opened Sets:</strong>&nbsp;Returns of opened LEGO sets must include the original packing slip or receipt and can be returned for exchange or merchandise credit only.</p>\r\n\r\n<p><strong>Customized Orders:</strong>&nbsp;Customized items such as LEGO Pick A Brick orders cannot be modified, returned or exchanged.</p>\r\n\r\n<p><strong>Software:</strong>&nbsp;Returns are only accepted if the item has not been opened. This includes but is not limited to video games and DVDs.</p>\r\n\r\n<p><strong>Gift Cards:</strong>&nbsp;Gift cards cannot be returned and cannot be exchanged for cash.</p>\r\n\r\n<p>If for any reason you are not entirely satisfied with an order, please&nbsp;contact our Customer Service team.</p>\r\n",
