				"returns": "<p><strong>Returns &amp; Replacements<br />\r\nQ. Can I exchange or return an item?&nbsp;</strong><br />\r\nA. You may return your unused product with tags attached for a full refund within 60 days of the purchase date. Any items returned after 60 days will not be processed. We do not offer direct exchanges, so if you wish to exchange product you will need to return the undesired product for a full refund and place a new order for your at oneillclothing.com.&nbsp;</p>\r\n\r\n<p><strong>Q. Can I return an item that I purchased at a wholesale retailer?&nbsp;</strong><br />\r\nA. Sorry, but we only accept returns on product that was purchased through oneillclothing.com.</p>\r\n\r\n<p><strong>Q. How do I return an item?&nbsp;</strong><br />\r\nA. Complete the return form that came with your order by checking the &ldquo;Return&rdquo; box and filling it out for each item being returned. Determine the &ldquo;Reason Code&rdquo; from the key below and include a code for each item, then place the completed form inside of your package. If you do not have the invoice that came with your order, please contact us to obtain a new one. Then detach and fasten the unpaid return barcode label to the outside of your package. If a UPS label is included with your shipment, fasten it to the outside of your package and call UPS to schedule a pickup or take it to the nearest UPS store. Remember to remove or cover any other labels and barcodes on the package. Send the return to the address below:&nbsp;</p>\r\n\r\n<p>O&#39;Neill Web Returns<br />\r\n14350 Myford Road<br />\r\nIrvine, CA 92606</p>\r\n\r\n<p>Keep tracking on your return as we are not liable for returned merchandise that is lost in transit. Please allow 2-4 weeks for your return to be processed. Also, be aware that your credit card company may require an additional 3-7 days to post the credit to your account. We will send you a confirmation email once it has been processed by our warehouse.<br />\r\n&nbsp;<br />\r\n<strong>Q. Do I have to cover the cost of return shipping?&nbsp;</strong><br />\r\nA. Return shipping labels are included free of charge for orders over $100.</p>\r\n\r\n<p><strong>Privacy &amp; Security<br />\r\nQ. Is your site secure?&nbsp;</strong><br />\r\nA. Our secure servers protect your information using advanced encryption and firewall technology throughout the ordering process. Most browsers will show a lock icon in the bottom status bar on secure pages. Look for this icon on any web page that asks for your personal information. To further ensure your security, we use state of the art SSL (secure sockets layer) encryption to protect your personal information from unauthorized use. View Privacy Policy.&nbsp;</p>\r\n\r\n<p><strong>Viewing Orders</strong><br />\r\nYou can view your orders and check on their status by logging into your account.</p>\r\n\r\n<p><strong>Updating Account Information</strong><br />\r\nYou can update all your account info by logging into your account.</p>\r\n",
