				"returns": "<p><strong>RETURNS &amp; EXCHANGES</strong></p>\r\n\r\n<p><strong>adidas.com Return Policy</strong></p>\r\n\r\n<p>At adidas, we create products that help you perform better, play better and feel better. Whether you&rsquo;re using our shoes on the street or the court, or our apparel in the studio or on the field, we want you to be satisfied with your purchase.</p>\r\n\r\n<p>If you are not completely satisfied with your adidas.com purchase, for any reason, we will offer you a full refund within 30 days of purchase. *Some restrictions apply.</p>\r\n\r\n<p>*Because custom and personalized mi adidas products are made just for you, they are not returnable.</p>\r\n\r\n<p><strong>Return By Mail</strong></p>\r\n\r\n<p>We are sorry that it didn&rsquo;t work out. Please visit our online return page within 30 days of purchase to print your free return shipping label.</p>\r\n\r\n<p>Go to [http://www.adidas.com/us/order-returns]&nbsp;to access Online Returns Page.</p>\r\n\r\n<p>Log in to your account OR sign in as a guest by entering your order number and shipping zip code.</p>\r\n\r\n<p>Select the item you want to return along with the reason for returning them.</p>\r\n\r\n<p>Include the return detail slip for each order you are returning. Attach the shipping label to the box. Cover up any previous delivery addresses or barcodes on the box.</p>\r\n\r\n<p>Drop your labeled return shipment at any UPS Store or UPS drop-off location.</p>\r\n\r\n<p>We are unable to return merchandise obtained from a retailer other than www.adidas.com. Please return the product to the original retailer.</p>\r\n\r\n<p><strong>Return In Store</strong></p>\r\n\r\n<p>You may return your adidas.com purchase at an adidas retail store within 30 days of purchase. The original form of payment and invoice are required for the store to process your return at the full purchase price. If the receipt is not available, an in store credit will be issued at the current product price.</p>\r\n\r\n<p>adidas retail stores are unable to accept returns for orders payed with PayPal. Please return PayPal orders by mail.</p>\r\n\r\n<p><strong>Gift Return</strong></p>\r\n\r\n<p>If you are the recipient of a gift from our website and want to return it, please set up a Return Authorization request for an adidas gift card with&nbsp;Corporate Consumer Relations (http://www.adidas.com/us/help-topics-Contact+Us.html) ;</p>\r\n\r\n<p><strong>Exchange</strong></p>\r\n\r\n<p>Need to make a change? At this time, we do not offer product exchanges. You may return your product within 30 days using our free returns option for a full credit and re-order your replacement item.</p>\r\n\r\n<p><strong>Refund</strong></p>\r\n\r\n<p>We will process your return within 7-10 business days of receipt and apply a credit to your original payment method. You&rsquo;ll receive an email from us when this is complete. A credit will appear on your next statement, depending on the issuing bank and billing cycle. We do not refund shipping charges.</p>\r\n\r\n<p>If your order was purchased with a gift card, your refund will be issued to a new adidas gift card sent to the shipping address on your order via USPS.</p>\r\n\r\n<p>If your payment method was a combination of a credit card and a gift card, your refund will be issued to a new gift card first and sent to you via USPS. Any remaining credit owed will be applied to your original payment credit card.</p>\r\n",
