				"returns": "<p><strong><span style=\"font-size:18px\">Think Geek - RETURNS POLICY</span></strong></p>\r\n\r\n<p>We accept returns within 90 days for any reason (unless otherwise noted on the product page).</p>\r\n\r\n<p>We require an RMA.</p>\r\n\r\n<p>Returned items must be in original condition, including tags, booklets, and labels.</p>\r\n\r\n<p>REFUNDS</p>\r\n\r\n<p>Refund will be issued to original payment method.</p>\r\n\r\n<p>15% restocking fee will apply to some returns.</p>\r\n\r\n<p>You will be responsible for return shipping costs of non-defective merchandise if you use one of our pre-printed return shipping labels.</p>\r\n\r\n<p>NON-RETURNABLE ITEMS</p>\r\n\r\n<p>Food products, undergarments, blind box items, products withdownloadable content, and the Random Shirt of Awesomeness, and other items as noted on the product page cannot bereturned for refund or store credit.</p>\r\n\r\n<p>APPAREL EXCHANGES</p>\r\n\r\n<p>If you need a different size of an apparel item you ordered, please place an order for the new size and complete the&nbsp;RMA process&nbsp;for the old size. Just pay shipping to return the old item, then email&nbsp;exchanges@thinkgeek.com&nbsp;with your new order number, and we will refund the shipping &amp; any promotional price difference. Note that we can&#39;t do apparel exchanges for orders shipped outside the U.S.</p>\r\n\r\n<p>In the email, please include:</p>\r\n\r\n<p>Your name</p>\r\n\r\n<p>Original order #</p>\r\n\r\n<p>New order #</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If the size you desire is out of stock or you have questions, please contact Customer Service at 1-888-GEEKSTUFF (1-888-433-5788) or 703-293-6299.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>FAQ</strong></span></p>\r\n\r\n<p>How can I make a return?</p>\r\n\r\n<p>To return an item, you must have a Return Merchandise Authorization number (RMA).</p>\r\n\r\n<p><em><strong>How can I request an RMA?</strong></em></p>\r\n\r\n<p><strong>Go to</strong>&nbsp;the&nbsp;Order Management&nbsp;section under your Account. Orders that contain items eligible for return, 90 days old or less, will have a Return link to the right.</p>\r\n\r\n<p><strong>Enter the quantities</strong>&nbsp;you would like to return along with the reason, and follow any additional instructions.</p>\r\n\r\n<p><strong>After you get your RMA number</strong>, you will have the opportunity to have a return shipping label generated for you. If you choose not to use a label provided by us, ship your package back to us at the following address:</p>\r\n\r\n<p><strong>ThinkGeek Returns</strong><br />\r\nRMA:&nbsp;<strong>[ include your RMA# here ]</strong><br />\r\n2120 Creekside Pkwy<br />\r\nDock Door 82<br />\r\nLockbourne, OH 43137<br />\r\n(703) 293-6299</p>\r\n\r\n<p>Please place the barcode so it&#39;s highly visible on the return packaging. Do not slap a shipping label on the manufacturer&#39;s packaging. Securely package the returned product within an outer box.</p>\r\n\r\n<p>If that&#39;s all too confusing, you can contact us. Please contact Customer Service at 1-888-GEEKSTUFF (1-888-433-5788) or 703-293-6299</p>\r\n",
