				"returns": "<h3>RETURNS</h3>\r\n\r\n<div>\r\n<h3>RETURN TO A STORE</h3>\r\n\r\n<p>With more than 1,900 Sunglass Hut locations, you can find a store near you to return or exchange in person&nbsp;<br />\r\nwithin 90 days.</p>\r\nINSTRUCTIONS&nbsp;\r\n\r\n<p>Whether you made your purchase in person or online, you can always return or exchange products at one&nbsp;<br />\r\nof our Sunglass Hut stores. Just bring your product, proof of purchase and original packaging into a store&nbsp;<br />\r\nwithin 90 days of your purchase, and we&#39;ll provide you with a complete refund or exchange.<br />\r\n<br />\r\nRefunds will be issued in the same form as your original payment method. For purchases made with a gift&nbsp;<br />\r\ncard, a new gift card will be issued.<br />\r\n<br />\r\nWithout proof of purchase, you can exchange your purchase or get a store credit based on current selling&nbsp;<br />\r\nprices. Remember, products sold as &quot;Imperfect&quot; may not be returned or exchanged.</p>\r\n</div>\r\n\r\n<div>\r\n<h3>RETURN TO OUR CUSTOMER CARE CENTER</h3>\r\n\r\n<p>Our Free UPS Return Shipping lets you mail your purchase back to our Customer Care Center at no&nbsp;<br />\r\nadditional cost within 90 days.</p>\r\nINSTRUCTIONS&nbsp;\r\n\r\n<p>Returning online purchases by mail is super easy and always free. Here&#39;s what to do:<br />\r\n<br />\r\n1. Repackage your purchase, making sure to include your proof of purchases, along with your order number, name, address and telephone number.<br />\r\n2.&nbsp;Print a return label&nbsp;and fasten it to your package.<br />\r\n3. Drop your package at any UPS store, UPS Drop Box or simply hand it to a UPS driver.<br />\r\n4. Track your return at&nbsp;www.UPS.com.<br />\r\n<br />\r\nIt usually takes 3 to 5 business days to process your return once it&#39;s received at our Customer Care&nbsp;<br />\r\nCenter. Remember, your package needs to be post-marked on or before 90 days after your purchase for a&nbsp;<br />\r\nrefund. Refunds will be issued in the same form as your original payment method.<br />\r\n<br />\r\nFree UPS Return Shipping uses UPS Ground service. Customers bear the risk of loss for all items shipped&nbsp;<br />\r\nto Sunglass Hut until Sunglass Hut accepts and receives the delivery from UPS at Sunglass Hut&#39;s Customer&nbsp;<br />\r\nCare Center.<br />\r\n<br />\r\nIf you don&#39;t want to use Free UPS Return Shipping, you can always mail your package back on your own to&nbsp;<br />\r\nthe following address:<br />\r\n<br />\r\nSunglass Hut Customer Care Center<br />\r\nAttention: Online Returns Department<br />\r\n4638 Shelby Drive<br />\r\nMemphis, TN 38118<br />\r\n<br />\r\nIn this case, you&#39;ll be responsible for paying shipping costs.<br />\r\nPlease note that store purchases may not be returned by mail and must be returned to a store.</p>\r\n</div>\r\n\r\n<div>\r\n<h3>REPLACEMENT &amp; EXCHANGES</h3>\r\n\r\n<p>Occasionally sunglasses break. It&#39;s sad, but true. But when it happens to sunglasses bought at&nbsp;<br />\r\nSunglass Hut, we replace them with the same pair (or equivalent, if unavailable) at 50% off the&nbsp;<br />\r\noriginal price.</p>\r\nINSTRUCTIONS&nbsp;\r\n\r\n<p>Just send it back through our free UPS return service. If you want to speed up the process, call our&nbsp;<br />\r\ncustomer service team and tell them you want a quick exchange. They&#39;ll order your new merchandise, and&nbsp;<br />\r\nwe&#39;ll credit your account when it arrives.<br />\r\n<br />\r\nSimple.<br />\r\n<br />\r\nYou can also just walk into any one of our 2000+ store locations and, provided you&#39;ve got proof of purchase&nbsp;<br />\r\nand your original packaging, we&#39;ll exchange it on the spot.</p>\r\n</div>\r\n\r\n<h3>SUNGLASS HUT REPLACEMENT DISCOUNT</h3>\r\n\r\n<p>Broken sunglasses? Don&#39;t stress. If you break your sunglasses after 90 days of use but within&nbsp;<br />\r\n12 months of your purchase, our Sunglass Hut Replacement Discount lets you replace them with&nbsp;<br />\r\nthe same, or if unavailable, an equivalent pair at 50% off the original retail price. It&#39;ll definitely&nbsp;<br />\r\nhelp take the edge off a tragic moment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Keep in mind, this discount may only be used once and may not be combined with other discounts&nbsp;<br />\r\nor promotions. It does not apply to loss or theft, and you must present your proof of purchase&nbsp;<br />\r\nand damaged product. Maui Jim products and products sold as &quot;Imperfect&quot; are not eligible for&nbsp;<br />\r\nthis program.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have Maui Jim sunglasses, please call 1-888-628-4546.<br />\r\nIf you have Oakley sunglasses, please call 1-800-431-1439.<br />\r\nIf you have Ray-Ban sunglasses, please call 1-800-343-5594.<br />\r\nIf you have any other brands that need a repair, please call 1-800-SUNGLAS and our agents will be&nbsp;<br />\r\nmore than happy to assist you in getting the correct number you need.</p>\r\n",
