				"returns": "<p>You may return unworn and unwashed merchandise back to us within 30 days of receipt for a refund to the original form of payment. Refunds are processed based on applicable product and tax charges. Original shipping charges are not refunded.&nbsp;<br />\r\n<br />\r\nReturns without the original receipt must reference the order number, which you may reprint from the order status page on Vans.com if you were sign in prior to placing the order or from the order confirmation email. For customer convenience, all domestic orders are shipped with a prepaid US Postal Service shipping label.&nbsp;<br />\r\n<br />\r\nReturns only by US Postal Service:<br />\r\n1. Attach the prepaid US Postal Service return label to the outside of the return package. The prepaid label has Parcel Select RTN SVC printed near the top.<br />\r\n2. Detach the completed RETURN FORM below and place it inside the return package. Save the top portion for your records.<br />\r\n3. Pack and seal the product securely. The package can be picked up by the US Postal Service at your mailebox or dropped off at the Post Office or FedEx Retail location.<br />\r\n4. A full refund, excluding shipping charges will be issued on unworn merchandise within 30 business days. A refund will be issued to the original form of payment.<br />\r\n<br />\r\nReturns to a VANS Retail Store:<br />\r\n1. Vans.com orders can only be returned to a Vans company owned retail store not through other retailers such as JCPenney or Journeys.&nbsp;<br />\r\n2. Use the Store Locator to find the Vans company owned retail store nearest you with a company name listed as &quot;VANS - store name&quot;.<br />\r\n3. Bring your product, original packaging, and your Return Form. We will gladly process your return for credit or exchange.<br />\r\n<br />\r\nReturns by Mail for Custom Shoes:<br />\r\n1. To return custom shoes, first call Vans customer service at 855-909-8267 to request a refund<br />\r\n2. All Vans Customs orders must be returned with the original paperwork<br />\r\n3. All items must be returned, unused, within 30 days of receipt. Returns beyond 30 days will not be accepted.<br />\r\n4. On the documentation with the picture of your shoe design, please indicate the reason for returning a gift; wrong item shipped; wrong color, etc.<br />\r\n5. Pack and seal your return securely ( in the original package if possible) and include all original paper work. Please mail your return to:<br />\r\nVANS, LLC.&nbsp;<br />\r\nOrder No: ______&nbsp;<br />\r\n15700 Shoemaker Ave.&nbsp;<br />\r\nSanta Fe Springs, CA 90670<br />\r\n<br />\r\nNOTE: To ensure faster processing of your credit, please keep a record of the carrier&#39;s tracking number.&nbsp;<br />\r\n<br />\r\nSwimwear &amp; Intimate Apparel:<br />\r\nSwimwear and intimate apparel must be in new, never-worn condition with all original tags attached. If applicable, any protective inner lining must be intact to be accepted for return. Swimsuits or intimate apparel that has been worn may not be returned.&nbsp;<br />\r\n<br />\r\nFor Watches Only:<br />\r\nYour Vans Timing watch comes with a limited warranty that covers defects in materials and workmanship for a period of two (2) years from the date of purchase. Please note that the warranty does not cover the following:&nbsp;<br />\r\n<br />\r\n&bull; Damage to the watch case, battery, strap, bracelet, crystal and crown.<br />\r\n&bull; Damage resulting from improper use, accidents and normal wear and tear.<br />\r\n&bull; Water damage is not covered unless the watch is marked &quot;water-resistant.&quot;<br />\r\n&bull; Warranty will be voided if the product is disassembled in any manner by any party other than an in-house Vans Timing watch repair representative.<br />\r\n<br />\r\nReturns for a defective watch will ONLY be accepted with a Return Authorization (RA) number. If your watch is defective, please email vanstiming@vestalwatch.com to be issued a Return Authorization (RA) number. Below is the return information for watches only.&nbsp;<br />\r\n<br />\r\nWatch Warranty/Returns-Vans Timing Watches<br />\r\n730 West 17th Street<br />\r\nCosta Mesa, CA 92627<br />\r\nvanstiming@vestalwatch.com&nbsp;</p>\r\n",
