				"returns": "<p><strong><span style=\"font-size:14px;\">RETURN POLICY</span></strong></p>\r\n\r\n<p>We want you to be fully satisfied with every item you purchase from ALDO. If, for whatever reason, you are not satisfied with your purchase, we will accept returns at ANY TIME after purchase if the following conditions are met:&nbsp;<br />\r\n- All items must be unworn.<br />\r\n- All Items must be in their original packaging.<br />\r\n- You must include the original sales receipt.<br />\r\n- For hygienic reasons, underwear, earrings and cosmetics cannot be exchanged or refunded at any time.<br />\r\n- Items can only be exchanged or returned for a refund in the country in which they were purchased. See country specific site fordetails.&nbsp;<br />\r\n<br />\r\n<strong>Bikini- Return Policy</strong><br />\r\nPlease note that we accept returns on bikini if the following conditions are met:<br />\r\n- Customer has their receipt.<br />\r\n- The hygiene strip must still be on the bikini in order to accept the return.</p>\r\n\r\n<p><strong>PLEASE NOTE: Our same great Return Policy applies to items purchased from our Clearance section.</strong><br />\r\nWe offer the following convenient options to return your items.</p>\r\n\r\n<p><strong>RETURN YOUR PURCHASE TO &nbsp;AN ALDO STORE *</strong><br />\r\n<strong>1&nbsp;</strong>Find an ALDO store near you using our&nbsp;store locator. Your closest ALDO store is also indicated on your packing slip or order confirmation email (for online orders).</p>\r\n\r\n<p><strong>2 </strong>Return the item(s) to the store of your preference where our associates will be pleased to assist you.</p>\r\n\r\n<p><strong>3.</strong> You will be refunded at the store through the same payment method that was used to purchase the items*.</p>\r\n\r\n<p><strong>*PLEASE NOTE:</strong><br />\r\n- Checks may only be refunded in cash 10 days after the purchase date. Shipping fees are non-refundable. Earrings cannot be exchanged or refunded at any time.<br />\r\n- For purchases made using PayPal, returns can only be processed online and refunds will be credited directly to your PayPal account. We will not be able to process PayPal returns in store.</p>\r\n\r\n<p><strong>1&nbsp;</strong>Enter your order # and zip code from your shipping address in the fields below.</p>\r\n\r\n<p><strong>2&nbsp;</strong>Select the item(s) you wish to return, choose a reason from the list and click submit.</p>\r\n\r\n<p><strong>3&nbsp;</strong>You will receive an email from ALDO confirming that your return request has been received. You will also receive your return label as well as instructions on how to arrange for courier pick-up or drop-off.</p>\r\n\r\n<p><strong>4.&nbsp;</strong>Once they have been received by UPS, returned items are usually delivered to us within 3 to 5 business days. Once we have received the item(s), you will be reimbursed for the cost of the items purchased and the amount should appear on your credit card statement within 5 to 10 business days following this.</p>\r\n\r\n<p><strong>**PLEASE NOTE:</strong><br />\r\n- Orders placed in store cannot be returned by courier, but can be returned or exchanged at any ALDO store.<br />\r\n- Checks may only be refunded in cash 10 days after the purchase date. Shipping fees are non-refundable. Earrings cannot be exchanged or refunded at any time.</p>\r\n",
