				"returns": "<h4>WHAT IS YOUR RETURN/EXCHANGE POLICY?</h4>\r\n\r\n<p>Returns &amp; Exchanges must have a RMA number to be accepted. To get a RMA number please call 855-717-3963. You can also e-mail our customer service department at customerservice@afflictionclothing.com.</p>\r\n\r\n<p>We guarantee our merchandise to be free of manufacturing defects and will accept any defective item for refund or exchange. AfflictionClothing will issue a refund within 30 days of purchase in the form and amount tendered for the original transaction.</p>\r\n\r\n<p>We do not accept ANY returns on DISCOUNTED or SALE product.</p>\r\n\r\n<p>All returns or exchanges must be unwashed, unworn, unused and in their original condition with receipt and tags attached.</p>\r\n\r\n<p>Merchandise received after 30 days will only be accepted at our discretion for an online store credit.</p>\r\n\r\n<p>AfflictionClothing gift certificates are non refundable.</p>\r\n\r\n<p>We will only refund shipping charges if we sent the wrong item or the item sent was defective. If you are making an exchange because you would like a different size, style or color, you will be charged for shipping on your exchange. The return/exchange value is determined by the last retail price of the item.</p>\r\n\r\n<p>Please note: We do not accept returns on products that were not purchased via this website.</p>\r\n\r\n<p>Please use the most economical shipping method for your return. We cannot reimburse you for an amount greater than your purchase amount.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>HOLIDAY RETURN POLICY</h4>\r\n\r\n<p>Orders placed between November 23 and December 24 may take advantage of our extended holiday return policy. During these dates, Affliction Clothing will issue a refund within 50 days of purchase in the form and amount tendered for the original transaction.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>WHERE DO I SHIP MY RETURN/EXCHANGE?</h4>\r\n\r\n<p>Please write your RMA number clearly on the outside of the box. Include the packing slip with the RMA number written on it in the box, and return to:<br />\r\nAffliction Clothing Store<br />\r\nATT: Returns<br />\r\n1799 Apollo Court<br />\r\nSeal Beach, CA 90740</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>HOW SHOULD I SHIP MY RETURN/EXCHANGE?</h4>\r\n\r\n<p>Pack and seal your box securely, in the original package if possible. Please write your RMA number clearly on the outside of the box and on the packing slip. Please include the packing slip in your box. You should ship your return/exchange with a carrier who will provide your package with a tracking number to ensure that your package does not get lost. Affliction Clothing is not responsible for return merchandise lost during shipping. Packages must be returned prepaid. We do not accept COD.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>WHEN WILL MY CREDIT CARD BE REFUNDED?</h4>\r\n\r\n<p>Once your package has been received, your refund or exchange will be processed within 7 business days. If there is a refund due, a credit will be issued in the original form of payment.</p>\r\n\r\n<p>The credit may not show up until your credit card&#39;s next monthly billing cycle. You will be notified via email to the address listed on your order when this transaction has taken place. Please note that your banking institution may require additional days to process and post this transaction to your account once they have received the information from us. When processing your exchange we automatically credit you in the original form of payment and reauthorize a new payment for your exchange. If you have used a banking or debit card your financial institutions policies may result in a non-sufficient funds charge if you are executing a return/exchange.</p>\r\n",
