				"returns": "<p>RETURNS POLICY</p>\r\n\r\n<p>shop.reebok.com</p>\r\n\r\n<p>Reebok offers free returns for all products purchased on shop.reebok.com excluding YourReebok and Personalized items. You may return your purchase within 30 days from receipt for a full refund. If the return falls outside of this period, or the item is worn, damaged, or not in its original packaging, Reebok cannot guarantee that the product refund request will be honored.</p>\r\n\r\n<p>YourReebok and Personalized items are created just for you. That means we cannot accept returns on these items.</p>\r\n\r\n<p>Apparel returns can only be accepted if the original label/hang tag has not been removed.</p>\r\n\r\n<p>To return a product, please follow the instructions below:&nbsp;Reebok stands behind the quality of its product. For purchases made at any store location, you may return it to the nearest Reebok store location at any time you find our product unsatisfactory. If you present the original sales receipt, we will gladly exchange the product or issue a refund based on the method of payment. If an original receipt does not accompany the return, a merchandise credit will be issued at the lowest selling price of the returned item. If you have additional questions or concerns, please call 1-866-870-1743 (M-F, 9am &ndash; 5pm EST.)</p>\r\n",
