						"description": "Train like a fighter in our TLAF mma short. <li>Polyester / Elastane, jersey fabrication for move-ready fit with a cottony feel</li> <li>Regular Fit - not too tight or too loose, perfect for all workouts</li> <li>Speedwick tech dissipates sweat to keep skin dry and comfortable</li> <li>Odor-reducing treatment for defeating the smells sweat brings to the ring</li> <li>Hook-and-loop flap waistband closure for a solidly secure fit</li> <li>Engineered side slits for enhancing your short&apos;s range of motion</li> <li>Interior hem pocket for stashing your mouthguard when not in use</li>",
