				"returns": "<p><strong>Returns and Exchanges</strong></p>\r\n\r\n<p>Returns and exchanges will not be accepted for items purchased at: Walt Disney World&reg; Resort, Disneyland&reg; Resort, World of Disney&reg; locations, Disney Cruise Line&reg; Ships, Disney&#39;s Soda Fountain Shop in Hollywood, California, and Disney Baby locations.</p>\r\n\r\n<p>DisneyStore.com will gladly exchange, credit or refund the purchase of any DisneyStore.com merchandise purchased through DisneyStore.com if returned within 30 days of the shipping date.</p>\r\n\r\n<p>Art, Limited Edition items and Vinylmation purchases must be returned in original condition at time of purchase, in the original unopened packaging within 30 days of the shipping date, must include the original packing slip and may only be returned if found to be defective.</p>\r\n\r\n<p>Personalized, Customized or Create Your Own items may not be returned or exchanged unless damaged or defective.</p>\r\n\r\n<p><strong>Returns with Gift Receipts</strong></p>\r\n\r\n<p>A full refund in the form of a merchandise credit will be issued.</p>\r\n\r\n<p><strong>Returns or Exchanges by Mail</strong></p>\r\n\r\n<p>Merchandise may be returned or exchanged by mail via prepaid UPS or insured USPS (to the address below) using the pre-addressed label attached to the packing slip. Your name and address must be included on the label (packages will not be accepted without a return name and address). Allow 2 weeks for processing.</p>\r\n\r\n<p>DisneyStore.com<br />\r\n4795 Imagination Drive<br />\r\nMemphis, TN 38118</p>\r\n\r\n<p>For merchandise returns and/or exchanges for new merchandise, please follow the instructions below:</p>\r\n\r\n<p><strong>Preparing your return:</strong></p>\r\n\r\n<p>Make a copy of the packing slip for your records.<br />\r\nUse the original packaging or strong corrugated carton.<br />\r\nTo expedite your return/exchange, insert the packing slip and be sure to keep the return label printed on the front for shipping.<br />\r\nIf your exchange order requires additional payment, please contact Guest Services.<br />\r\nMoney orders, cashiers&#39; checks or personal checks will not be accepted. If received, the order will be returned to you with a letter of explanation.<br />\r\nPack and tape your package securely.<br />\r\nAffix the return shipping label to the package.<br />\r\nFor tracking purposes, it is important that you ship your package via United Parcel Service (UPS) or insured Parcel Post. (We cannot accept C.O.D.)<br />\r\n<br />\r\n<strong>Special Products and Exceptions</strong></p>\r\n\r\n<p>Merchandise purchased between November 7th and December 18th will be accepted through January 18th. Merchandise purchased after December 18th is subject to the terms stated above.</p>\r\n\r\n<p>Special Order merchandise, Gift Wrap and Shipping/Handling Fees may not be returned or exchanged.</p>\r\n\r\n<p>DVD, Video, Audio and Software merchandise (excluding Special Order DVDs) must be returned in the original, unopened packaging and be accompanied by the original sales receipt. Damaged or defective DVD, Video, Audio and Software merchandise may only be exchanged for the same merchandise and title (if still available).</p>\r\n\r\n<p>MagicBands may not be returned or exchanged.</p>\r\n\r\n<p>Memberships are non-refundable, non-transferable, may not be redeemed for cash or converted to Merchandise Credits.</p>\r\n\r\n<p>The Disney Gift Card is not redeemable for cash. Please provide required proof of purchase to replace or cancel a lost, stolen or damaged Disney Gift Card. Certain restrictions apply. Please refer to Disney Gift Cards Frequently Asked Questions for details.</p>\r\n\r\n<p>Price adjustments will be issued to the address provided in the form of a DisneyStore.com Gift Card on merchandise purchased from DisneyStore.com or through Buy in-Store/Ship to-Home within 7 days from the shipping date. Price adjustments are not valid on Deal of the Day merchandise.</p>\r\n\r\n<p>Gift with Purchase or Purchase with Purchase items must accompany the original purchase item when returned.</p>\r\n\r\n<p>Email us through our Contact Us page to request a price adjustment on qualifying purchases. Include the Order Number and Item Number in your request.</p>\r\n\r\n<p>Returns or exchanges of merchandise purchased from DisneyStore.com can be made to any Disney Store location in the continental United States in accordance with the in-Store Return Policy, excluding Personalized Items, Art, Limited Edition items (excluding apparel), Vinylmation, Mirrors, Electronics, Indoor and Outdoor Furniture, and Special Order merchandise. All returns must have the original packing slip/receipt with the merchandise to be returned or exchanged.</p>\r\n\r\n<p>Merchandise purchased online by PayPal&trade;, or other form of tender will, subject to the terms stated above, be refunded as a Merchandise Credit. Merchandise purchased online using multiple forms of tender may only be returned directly to DisneyStore.com, per the instructions found on the back of the packing slip.</p>\r\n\r\n<p>Refund Policy is subject to change, for any or no reason, from time to time in Disney&#39;s sole discretion without advance notice to its Guests.</p>\r\n",
