				"returns": "<p><strong>Exchanges</strong></p>\r\n\r\n<p>We do not accept exchanges at this time.</p>\r\n\r\n<p><strong>Return Policy</strong></p>\r\n\r\n<p>We&#39;re bummed things didn&#39;t work out for you, but here&#39;s the good news: we accept returns within thirty (30) days of purchase (AKA the date listed on your receipt) for most items in new condition.</p>\r\n\r\n<p>Here&#39;s the fine print. You just can&#39;t return anything that&#39;s worn, damaged, washed, or altered in any way. All original tags must be attached, footwear must be in its original shoebox, and swimwear &amp; bodysuits must have the hygiene liners intact. Also, gift cards are non-returnable and non-refundable.</p>\r\n\r\n<p>The following items cannot be returned or exchanged: opened makeup, earrings, ear cuffs, panties, and any other items marked as &quot;Final Sale.&quot;</p>\r\n\r\n<p><strong>U.S. Hassle-Free Returns</strong></p>\r\n\r\n<p>Returns for online store credit will be processed free of charge, while returns for a refund to your original payment method (i.e. credit card, Paypal) will require a handling &amp; processing fee of $5.99, which will be deducted from the amount to be refunded to you. Original shipping charges are non-refundable.</p>\r\n\r\n<p>Start your return on https://www.nastygal.com/returns.<br />\r\nOnce you have found your order, click the &quot;Return This Order&quot; button<br />\r\nSelect the order or item(s) you would like to return and indicate the reason for your return.<br />\r\nChoose a return for online store credit or for a refund. Please note, returns for online store credit will be processed free of charge, while returns for a refund to your original payment method (i.e. credit card, Paypal) will require a handling &amp; processing fee of $5.99, which will be deducted from the amount to be refunded to you. Please note that original shipping charges are non-refundable.<br />\r\nPrint your label and place label on the outside of the package.<br />\r\nDrop off at your nearest UPS location.<br />\r\n<br />\r\n<strong>International Returns</strong></p>\r\n\r\n<p>You must return your items to the address below within 30 days from the day you received your package. Please write your order # on the outside of the package. You will receive your refund in the original form of payment. Unfortunately we cannot refund duties, taxes or shipping charges.</p>\r\n\r\n<p>Nasty Gal Returns<br />\r\nOrder # _________<br />\r\n700 Omega Parkway, Suite 300<br />\r\nShepherdsville, KY 40165<br />\r\n<br />\r\n<strong>Refunds and Processing</strong></p>\r\n\r\n<p>Refunds will be processed within approximately 7 to 10 business days after we receive your return.<br />\r\nOriginal shipping charges are non-refundable.<br />\r\n<br />\r\n<strong>Online Store Credit</strong></p>\r\n\r\n<p>Online Store Credit can only be used online at our website, www.nastygal.com.<br />\r\nOnline Store Credit cannot be transferred to another person or account.<br />\r\nPlease treat Online Store Credit like cash.<br />\r\nOnline Store Credit may not be purchased and is only provided when previously purchased items have been returned and you have selected &quot;Store Credit&quot; as the refund method.<br />\r\nOnline Store Credit may be used to purchase gift cards to our store.<br />\r\nAny purchase amounts that exceed the value of the Online Store Credit will require an additional method of payment for the remaining balance due.<br />\r\nOnline Store credit never expires.<br />\r\nOnline Store credit is provided in U.S. Dollars.<br />\r\nYour use of the Online Store Credit constitutes your agreement to our Terms.<br />\r\nTo view your Online Store Credit Balance, log into your Nasty Gal account. Your Store Credit balance will be displayed on the &ldquo;My Account&rdquo; page.<br />\r\nFor more information about Online Store Credit, please contact Customer Care.</p>\r\n",
